import React from 'react'

const Galleryview = () => {

    let data = [
        {
          id: 1,
          title: "Lorem ipsum",
          subTitle: "Lorem",
          image: '/galleryimg/3dmodel.PNG'
        },
        {
          id: 2,
          title: "Lorem ipsum",
          subTitle: "Lorem",
          image: '/galleryimg/3dmodel1.PNG'
        },
        {
          id: 3,
          title: "Lorem ipsum",
          subTitle: "Lorem",
          image: '/galleryimg/3dmodel2.PNG'
        },
        {
          id: 4,
          title: "Lorem ipsum",
          subTitle: "Lorem",
          image: '/galleryimg/3dmodel3.PNG'
        },

      ];



    return (
        <div className='gallery'>
          {data.map((item, index)=>{
            return(
              <div className='pics' key={index}>
                <img src={item.image} alt='' style={{ width: '100%' }}/>

              </div>
            )
          })}

        </div>
    )
}

export default Galleryview
